import { Helmet } from 'react-helmet';


const LandingPage = () => {
  return (
    <div>
      <Helmet>
        <title>BCI Initiative</title>
      </Helmet>

      <h1>Welcome to my Landing Page</h1>
      {/* <Link to="/other-page">Go to Other Page</Link> */}
    </div>
  );
};

export default LandingPage;
